import React from 'react';
import { Route, Routes, useNavigate } from 'react-router-dom';
import MainPage from '../../pages/MainPage/MainPage';
import './App.css';

function App() {
  return (
    <div className="App">
      <Routes>
      <Route element={<MainPage />} path="/" />
      <Route element={<NewsPage />} path="/welcome" />

      </Routes>

    </div>
  );
}

export default App;
